import styles from "./Form.module.css";
function Form() {
  return (
    <div>
      <form className={styles.form}>
        <div className={styles.form__email}></div>
        <div className={styles.form__number}></div>
        <button className={styles.form__button}></button>
      </form>
    </div>
  );
}

export default Form;
